{"role.conf":"MachineGroups:
  admingateway: []
  fuxi_master: []
  package_manager: []
  tubo: []
ServerRoles:
  DeployAgent#: tubo
  FuxiMaster#: fuxi_master
  FuxiMonitor#: tubo | fuxi_master | package_manager
  FuxiTools#: admingateway
  Package#: admingateway
  PackageManager#: package_manager
  Tubo#: tubo
","tag.conf":"Tags: {USECGROUP_FLAG: 1, SANDBOX_FLAG: 1, TUBOWORKER_SLS_FOLDER: /apsara/tuboSLS/,
  CGROUP_CPU_CONFIG: CPUSET, CGROUP_NET_CONFIG: 'true', FUXI_OVERSOLD_RESOURCE: '[{"Name":"CPU_RT_GARUDA","Origin":"CPU","Info":{"Type":"RT_RR","Priority":50}},{"Name":"CPU_RT_GALAXY","Origin":"CPU","Info":{"Type":"RT_RR","Priority":49}}]'}
","tianji":{"availability.conf":"availability:
  DeployAgent#: {mode: 100%}
  FuxiMaster#: {mode: '1'}
  FuxiMonitor#: {mode: 100%}
  FuxiTools#: {mode: 100%}
  Package#: {mode: 100%}
  PackageManager#: {mode: '1'}
  Tubo#: {mode: 100%}
","plan.conf":"- ServerRole: DeployAgent#
  Dependency: [FuxiMaster#, PackageManager#]
  RollbackOnFailure: 0
  RollingMode: normal
- ServerRole: FuxiMaster#
  Dependency: [FuxiTools#]
  RollbackOnFailure: 0
  RollingMode: normal
- ServerRole: FuxiMonitor#
  Dependency: []
  RollbackOnFailure: 0
  RollingMode: normal
- ServerRole: FuxiTools#
  Dependency: []
  RollbackOnFailure: 0
  RollingMode: normal
- ServerRole: Package#
  Dependency: [DeployAgent#, Tubo#]
  RollbackOnFailure: 0
  RollingMode: normal
- ServerRole: PackageManager#
  Dependency: [FuxiTools#]
  RollbackOnFailure: 0
  RollingMode: normal
- ServerRole: Tubo#
  Dependency: [FuxiMaster#, PackageManager#]
  RollbackOnFailure: 0
  RollingMode: normal
","roleattributes.conf":"attributes:
  DeployAgent#: {prob_time_out: 600000, prob_slice_wind: 180000}
  FuxiMaster#: {prob_time_out: 600000, prob_slice_wind: 180000}
  FuxiMonitor#: {prob_time_out: 600000, prob_slice_wind: 180000}
  FuxiTools#: {prob_time_out: 300000, prob_slice_wind: 1000}
  Package#: {prob_time_out: 600000, prob_slice_wind: 180000}
  PackageManager#: {prob_time_out: 600000, prob_slice_wind: 180000}
  Tubo#: {prob_time_out: 600000, prob_slice_wind: 180000}
"},"user":{"cgroup.json.jj2":"{% set fuxi_floor = [tj_tag.MachineHwCpus|int//10,1]|max + [tj_tag.MachineHwCpus|int//20,1]|max %}     
{% set fuxi_ceiling = tj_tag.MachineHwCpus|int - 1 %}

{
    "CgroupRequirements":
    {
        "memory":{
            "expression":{
                "MemForDA": "2*1024*1024*1024",
                "MemForDAHardLimit": "MemForDA*5",
                "MemForTubo": "MemForApsara - MemForDA + 500*1024*1024 - MemForPanguChunkserver"
            },
            "groups":{
                "apsara/tubo":{
                    "memory.limit_in_bytes" : "MemForTubo",
                    "memory.memsw.limit_in_bytes" : "MemForTubo"
                },
                "apsara/kfc/others":{
                    "memory.limit_in_bytes" : "MemForDAHardLimit",
                    "memory.memsw.limit_in_bytes" : "MemForDAHardLimit",
                    "memory.soft_limit_in_bytes" : "MemForDA"
                }
            }
        },
        "net_cls":{
            "expression":{
		{% if tj_tag.MachineHostname in tj_tag.ClusterMachineGroup.Frontend %}
			"NetForTubo": "0.9 * TotalNet",
		{% else %}
			"NetForTubo": "0.7 * TotalNet",
		{% endif %}	

                "TuboBurst": "NetForTubo*1024*8/40"
            },
            "groups":{
                "apsara/tubo/normal_workers" : {
                    "classid" : "0x0002",
                    "min"  : "NetForTubo",
                    "max"  : "NetForTubo",
                    "prio" : "0",
                    "burst": "TuboBurst",
                    "cburst": "TuboBurst"
                }
            }
        },
		"cpu" : { 
            "groups": {
                "apsara" : { 
                },
                "apsara/tubo" : {
                },
                "apsara/tubo/normal_workers" : {
                }
            }
        },
		"cpuset" : { 
            "groups": {
		{% if tj_tag.MachineNicType in ["N36.22"] %}
		"apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "7-55"
                },
		"apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "7-55"
                },
		{% elif tj_tag.MachineNicType in ["Q46.22","Q46.2B","Q46.2C"] %}
		"apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "0-55"
                },
		"apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "0-55"
                },
		{% elif tj_tag.MachineNicType in ["Q48.2B","Q48.22"] %}
		"apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "4-39"
                },
		"apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "4-39"
                },
		{% elif tj_tag.MachineNicType == "S10-3S.12" %}
		"apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "2-31"
                },
		"apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "2-31"
                },
		{% elif tj_tag.MachineNicType == "N35.22" %}
		"apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "4-31"
                },
		"apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "4-31"
                },
		{% elif tj_tag.MachineNicType in ["N46.22","N46S1.2B","N46S1.22"] %}
                "apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "9-63"
                },
                "apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "9-63"
                },
		{% elif tj_tag.MachineNicType in ["W1.22","W2.12"] %}
                "apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "0-31"
                },
                "apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "0-31"
                },
		{% elif tj_tag.MachineNicType in ["W41.22","W41.2B"] %}
		"apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "0-63"
                },
                "apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "0-63"
                },
		{% elif tj_tag.MachineHostname in tj_tag.ClusterMachineGroup.Frontend %}
		"apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "0-{{ fuxi_ceiling }}"
                },
                "apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "0-{{ fuxi_ceiling }}"
                },
		{% elif tj_tag.MachineHostname in tj_tag.ClusterMachineGroup.Chunkserver %}
		"apsara/tubo" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "{{ fuxi_floor }}-{{ fuxi_ceiling }}"
                },
                "apsara/tubo/normal_workers" : {
                    "cpuset.mems" : "0",
                    "cpuset.cpus" : "{{ fuxi_floor }}-{{ fuxi_ceiling }}"
                },
		{% endif %}

		"apsara" : {
                }
            }
        }
    }
}
","cgroup.json.old":"{
    "CgroupRequirements":
    {
