"},"user":{"cgroup.json.jj2":"{% set pangu_floor = [tj_tag.MachineHwCpus|int//20,1]|max %}     
{% set pangu_ceiling = [tj_tag.MachineHwCpus|int//10,1]|max + [tj_tag.MachineHwCpus|int//20,1]|max - 1 %}
{
    "CgroupRequirements":
    {
        "memory":{
            "expression":{
                "MemForPanguMaster": "MemForApsara - 1.5*1024*1024*1024",
                "MemForPanguMasterSoftLimit": "MemForApsara*0.5",
                "MemForPanguChunkserver": "4*1024*1024*1024",
                "MemForPanguChunkserverHardLimit": "MemForPanguChunkserver"
            },
            "groups":{
                "apsara/pangu/master":{
                    "memory.limit_in_bytes" : "MemForPanguMaster",
                    "memory.memsw.limit_in_bytes" : "MemForPanguMaster",
                    "memory.soft_limit_in_bytes" : "MemForPanguMasterSoftLimit"
                },
                "apsara/pangu/chunkserver":{
                    "memory.limit_in_bytes" : "MemForPanguChunkserverHardLimit",
                    "memory.memsw.limit_in_bytes" : "MemForPanguChunkserverHardLimit",
                    "memory.soft_limit_in_bytes" : "MemForPanguChunkserver"
                }
            }
        },
        "net_cls":{
            "expression":{
                "NetForPangu": "0.2 * TotalNet",
                "PanguBurst": "NetForPangu*1024*8/40"
            },
            "groups":{
                "apsara/pangu/chunkserver" : {
                    "classid" : "0x0003",
                    "min"  : "NetForPangu",
                    "max"  : "NetForPangu",
                    "prio" : "0",
                    "burst": "PanguBurst",
                    "cburst": "PanguBurst"
                }
            }
        },
        "cpuset":{
            "expression":{
            },
            "groups":{
		{% if tj_tag.MachineNicType == "S10-3S.12" %}
                "apsara/pangu/chunkserver" :{
                    "cpuset.mems": "0",
                    "cpuset.cpus": "0,1"
                },
                {% elif tj_tag.MachineNicType in  ["N35.22","Q48.2B","Q48.22"] %}
                "apsara/pangu/chunkserver" :{
                    "cpuset.mems": "0",
                    "cpuset.cpus": "1,2,3"
		},
                {% elif tj_tag.MachineNicType in ["N36.22"] %}
                "apsara/pangu/chunkserver" :{
                    "cpuset.mems": "0",
                    "cpuset.cpus": "2,3,4,5,6"
                },
		{% elif tj_tag.MachineNicType in  ["N46.2B","N46.22","N46S1.2B","N46S1.22"] %}
		"apsara/pangu/chunkserver" : {
                    "cpuset.mems": "0",
                    "cpuset.cpus": "3,4,5,6,7,8"
                },
		{% elif tj_tag.MachineHostname in tj_tag.ClusterMachineGroup.Chunkserver and pangu_floor == pangu_ceiling %}
                "apsara/pangu/chunkserver" : {
                     "cpuset.mems" : "0",
                     "cpuset.cpus" : "{{ pangu_floor }}"
		},
                {% elif tj_tag.MachineHostname in tj_tag.ClusterMachineGroup.Chunkserver and pangu_floor < pangu_ceiling %}
                "apsara/pangu/chunkserver" : {
                     "cpuset.mems" : "0",
                     "cpuset.cpus" : "{{ pangu_floor }}-{{ pangu_ceiling }}"
                },
                {% endif %}
		"apsara" : {
                },
                "apsara/pangu" : {
                }
            }
        }
    }
}
