user admin admin;
worker_processes auto;
worker_cpu_affinity auto;

pid     /apsara/ots_tengine/logs/tengine-ots.pid;

events {
    use epoll;
    worker_connections  100000;
}

dso {
    load    /apsara/ots_tengine/modules/ngx_http_uwsgi_module.so;
}

http {
    log_format  main  '$remote_addr - $remote_user [$time_local] "$request" '
                      '$status $body_bytes_sent $request_time -> $upstream_response_time '
                      '"$http_referer" "$http_user_agent" "$upstream_http_x_ots_requestid"';

    include    /apsara/ots_tengine/conf/mime.types;
    default_type  application/octet-stream;

    keepalive_requests 500;
    keepalive_timeout 30s;

    sendfile                on;
    tcp_nopush              on;

    server_tokens           off;
    server_info             off;
    server_tag              off;

    lingering_close on;
    lingering_time 30;
    lingering_timeout 5;

    upstream ots_server {
        server unix:/apsara/ots_server/data/ots.sock;

        check interval=3000 rise=2 fall=5 timeout=1000 type=tcp default_down=false;

        keepalive_timeout 60s;
        keepalive 5000;
    }

    upstream ots_server_admin {
        server unix:/apsara/ots_server/data/ots_admin.sock;

        check interval=3000 rise=2 fall=5 timeout=1000 type=tcp default_down=false;

        keepalive_timeout 10s;
        keepalive 20;
    }

    upstream rep_server {
        server unix:/apsara/sqlonline_replication_server/data/server.sock;
    }

    server {
        listen     {{${service:myService:ots.cluster_rep_dns_src_port}}};
        access_log  off;
        error_log  "pipe:/usr/sbin/cronolog  /apsara/ots_tengine/logs/rep_server_error_log.%Y%m%d"  warn;

        client_max_body_size 50m;

        location /heartbeat {
            alias     /var/www/html/rep_server.heartbeat;
        }

        location / {
            fastcgi_pass rep_server;
            fastcgi_index replication_server_test;
            include    /apsara/ots_tengine/conf/fastcgi_params;
        }

    }

    server {
        listen      {{${service:myService:ots.cluster_dns_src_port}}} backlog=8192 so_keepalive=on;

        access_log  off;
        error_log  "pipe:/usr/sbin/cronolog  /apsara/ots_tengine/logs/ots_server_error_log.%Y%m%d"  warn;

        client_header_buffer_size 8k;
        large_client_header_buffers 4 8k;
        client_body_buffers 4 32k;
        client_body_postpone_size 64k;
        client_max_body_size 64m;

        location /heartbeat {
            proxy_pass     http://127.0.0.1:{{${service:myService:ots.cluster_admin_dns_src_port}}}/AdminCheckHealthyStatus;
        }

        location / {
            fastcgi_pass ots_server;
            fastcgi_keep_conn on;
            fastcgi_param  1 $query_string;
            fastcgi_param  2 $request_method;
            fastcgi_param  3 $request_uri;
            fastcgi_param  4 $remote_addr;
            fastcgi_param  5 $server_addr;
            fastcgi_param  6 http;
            fastcgi_param  7 $remote_port;
            fastcgi_param  8 $server_port;
            fastcgi_param  9 $vpcid;

            fastcgi_request_buffering off;
            fastcgi_buffer_size 32k;
            fastcgi_buffers 64 32k;
            fastcgi_read_timeout 35s;
            fastcgi_send_timeout 35s;
            fastcgi_max_temp_file_size 0;
        }
    }

    server {
        listen      {{${service:myService:ots.cluster_admin_dns_src_port}}} backlog=8192 so_keepalive=on;

        access_log  off;
        error_log  "pipe:/usr/sbin/cronolog  /apsara/ots_tengine/logs/ots_server_admin_error_log.%Y%m%d"  warn;

        client_header_buffer_size 8k;
        large_client_header_buffers 4 4k;
        client_body_buffers 4 32k;
        client_body_postpone_size 64k;
        client_max_body_size 64m;

        location / {
            fastcgi_pass ots_server_admin;
            fastcgi_keep_conn on;
            fastcgi_param  1 $query_string;
            fastcgi_param  2 $request_method;
            fastcgi_param  3 $request_uri;
            fastcgi_param  4 $remote_addr;
            fastcgi_param  5 $server_addr;
            fastcgi_param  6 http;
            fastcgi_param  7 $remote_port;
            fastcgi_param  8 $server_port;
            fastcgi_param  9 $vpcid;

            fastcgi_request_buffering off;
            fastcgi_buffer_size 32k;
            fastcgi_buffers 64 32k;
            fastcgi_read_timeout 35s;
            fastcgi_send_timeout 35s;
            fastcgi_max_temp_file_size 0;
        }
    }
}
