user admin admin;
worker_processes auto;
worker_cpu_affinity auto;

pid    logs/tengine-ots.pid;

events {
    use epoll;
    worker_connections  100000;
}

dso {
    load    ngx_http_uwsgi_module.so;
}

http {
    log_format  main  '$remote_addr - $remote_user [$time_local] "$request" '
                      '$status $body_bytes_sent $request_time -> $upstream_response_time '
                      '"$http_referer" "$http_user_agent" "$upstream_http_x_ots_requestid"';

    include       mime.types;
    default_type  application/octet-stream;

    keepalive_requests 50;
    keepalive_timeout 10s;

    gzip                    on;
    sendfile                on;
    tcp_nopush              on;

    server_tokens           off;
    server_info             off;
    server_tag              off;
    lingering_close on;
    lingering_time 30;
    lingering_timeout 5;

    server {
        listen      {{${service:myService:ocm.src_port}}} backlog=8192 so_keepalive=on;
        
        access_log off;
        error_log "pipe:/usr/sbin/cronolog logs/ocm_error_log.%Y%m%d"  warn;

        client_header_buffer_size 8k;
        large_client_header_buffers 4 8k;
        client_body_buffers 4 32k;
        client_body_postpone_size 64k;
        client_max_body_size 8m;

        location /heartbeat {
            alias     /var/www/html/ocm.heartbeat;
        }

        location / {
            include uwsgi_params;
            uwsgi_pass 127.0.0.1:{{${service:myService:ocm.uwsgi_port}}};

            uwsgi_buffer_size 32k;
            uwsgi_buffers 64 32k;
            uwsgi_read_timeout 35s;
            uwsgi_send_timeout 35s;
            uwsgi_max_temp_file_size 0;
        }
    }
}

