"},"user":{"APIServer":{"cluster_common_schema.json":"{ 
    "type":"dir",
    "entries":{
        "cluster.conf":{
            "type":"file",
            "schema":{
                "type":"object",
                "properties":{
                    "Name":{
                        "type":"string",
                        "description":"cluster name"
                    },
                    "Region":{
                        "type":"string",
                        "description":"cluster region"
                    },
                    "Group":{
                        "type":"string",
                        "description":"cluster group"
                    },
                    "Project":{
                        "type":"string",
                        "description":"project"
                    },
                    "Machines":{
                        "type":"array",
                        "items":{
                            "type":"string"
                        },
                        "description":"machine list"
                    },
                    "Legacy":{
                        "enum":[ "true", "false", "True", "False" ],
                        "description": "default if true, will not trigger clone, set to false will trigger clone"
                    }
                },
                "required":[
                    "Name",
                    "Region",
                    "Group",
                    "Machines"
                ]
            }
        },
        "sys.conf":{
            "type":"file",
            "schema":{
                "type":"object",
                "properties":{
                    "os":{
                        "type":"object",
                        "description":"operating system",
                        "patternProperties":{
                            ".*":{
                                "type":"string",
                                "description":"key=* means all machines, or key is for machines of specified ServerRole"
                            }
                        }
                    },
                    "part":{
                        "type":"object",
                        "description":"system patition template",
                        "patternProperties":{
                            ".*":{
                                "type":"string",
                                "description":"key=* means all machines, or key is for machines of specified ServerRole"
                            }
                        }
                    },
                    "app_name":{
                        "type":"object",
                        "description":"app template",
                        "patternProperties":{
                            ".*":{
                                "type":"string",
                                "description":"key=* means all machines, or key is for machines of specified ServerRole"
                            }
                        }
                    },
                    "os_version":{
                        "type":"object",
                        "description":"os version",
                        "patternProperties":{
                            ".*":{
                                "type":"string",
                                "description":"key=* means all machines, or key is for machines of specified ServerRole"
                            }
                        }
                    },
                    "kernel":{
                        "type":"object",
                        "description":"kernel version",
                        "patternProperties":{
                            ".*":{
                                "type":"string",
                                "description":"key=* means all machines, or key is for machines of specified ServerRole"
                            }
                        }
                    },
                    "nic_driver":{
                        "type":"object",
                        "description":"network driver version",
                        "patternProperties":{
                            ".*":{
                                "type":"string",
                                "description":"key=* means all machines, or key is for machines of specified ServerRole"
                            }
                        }
                    }
                },
                "required":[
                    "os",
                    "part"
                ]
            }
        },
        "plan.conf":{
            "type":"file",
            "schema":{
                "type": "array",
                "items": {
                    "oneOf": [ {
                        "type" : "object",
                        "properties" : {
                            "GlobalParameters":{
                                "type":"object",
                                "description":"global deployment parameters",
                                "properties":{
                                    "RollbackOnFailure":{
                                        "enum":[ "0", "1" ],
                                        "description":"1, force upgrade"
                                    },
                                    "UnsafeMode":{
                                        "enum":[ "0", "1" ],
                                        "description":"1, unsafe mode"
                                    }
                                }
                            }
                        },
                        "additionalProperties": false
                    }, {
                        "type" : "object",
                        "properties" : {
                            "Action":{
                                "enum":[ "software" ]
                            },
                            "Services":{
                                "type":"array",
                                "items":{
                                    "type":"string"
                                },
                                "description":"sample：[apsara, tianji, fuxi]"
                            }
                        },
                        "dependencies": {
                            "Action": ["Services"],
                            "Services": ["Action"]
                        },
                        "additionalProperties": false
                    }, {
                        "type" : "object",
                        "properties" : {
                            "ServiceName":{
                                "type":"string"
                            },
                            "Dependency":{
                                "type":"array",
                                "items":{
                                    "type":"string"
                                },
                                "description":"sample：[apsara, tianji, fuxi]"
                            }
                        },
                        "dependencies": {
                            "Dependency": ["ServiceName"]
                        },
                        "additionalProperties": false
                    } ]
                },
                "required":[
                    "GlobalParameters"
                ]
            }
        },
        "tag.conf":{
            "type":"file",
            "schema":{
                "type":"object",
                "properties":{
                    "Tags":{
                        "type":"object",
                        "description":"user defined tags",
                        "patternProperties":{
                            "^ManageCgroup$":{
                                "enum":[ "True", "False", "true", "false" ]
                            },
                            ".*":{
                                "type":"string",
                                "description":"User defined values"
                            }
                        },
                        "additionalProperties": false
                    }
                }
            }
        },
        "services":{
            "type":"dir",
            "entries":{
                "tianji":{
                    "type":"dir"
                }
            },
            "required_entries":[
                "tianji"
            ]
        }
    },
    "required_entries":[
        "cluster.conf"
    ]
}

