","cross_file_rules.json":"{
    "rule1": {
        "SrcFile": "services/*/version.conf",
        "SrcItem": "Versions",
        "Operator": "in",
        "DstFile": "services/*/role.conf|services/*/resource_role.conf",
        "DstItem": "ServerRoles",
        "Description": "check serverroles of version.conf should in role.conf|resource_role.conf"
    },
    "rule2": {
        "SrcFile": "services/*/role.conf",
        "SrcItem": "ServerRoles",
        "Operator": "in",
        "DstFile": "services/*/tianji/availability.conf",
        "DstItem": "availability",
        "Description": "check serverroles of role.conf should in availability.conf"
    },
    "rule2_2": {
        "SrcFile": "services/*/resource_role.conf",
        "SrcItem": "ServerRoles",
        "Operator": "in",
        "DstFile": "services/*/tianji/availability.conf",
        "DstItem": "availability",
        "Description": "check serverroles of resource_role.conf should in availability.conf"
    },
    "rule3": {
        "SrcFile": "services/*/role.conf",
        "SrcItem": "MachineGroups::*",
        "Operator": "inwithcolon",
        "DstFile": "cluster.conf",
        "DstItem": "Machines",
        "Description": "check machines of role.conf should in cluster.conf"
    },
    "rule4": {
        "SrcFile": "services/*/role.conf",
        "SrcItem": "ServerRoles::*",
        "Operator": "inwithcolon",
        "DstFile": "cluster.conf",
        "DstItem": "Machines",
        "Description": "check machines of role.conf should in cluster.conf"
    },
    "rule5": {
        "SrcFile": "services/*/environment.conf",
        "SrcItem": "Environments",
        "Operator": "in",
        "DstFile": "services/*/role.conf",
        "DstItem": "ServerRoles",
        "Description": "check serverroles of environment.conf should in role.conf"
    }
}
