import yaml

def check_cert_files(conf):
    if "services" in conf and "tianji" in conf["services"] and "user" in conf["services"]["tianji"] and "region.conf" in conf["services"]["tianji"]["user"]:
        user_conf = conf["services"]["tianji"]["user"]
        region_conf = yaml.load(user_conf["region.conf"])
        if region_conf["REGION"]["HTTPS_MODE"].lower() == "https":
            #check if cert files exist
            if "https_certificates" not in user_conf or "conf" not in user_conf["https_certificates"]:
                print "Certificate dir not exist while https enabled: services/tianji/user/https_certificates/conf/"
            else:
                cert_list = user_conf["https_certificates"]["conf"]
                cert_file = ["privatecloud_key.pem", "privatecloud.pem", "privatecloud-terminal_key.pem", "privatecloud-terminal.pem"]
                miss_files = []
                for cert in cert_file:
                    if cert not in cert_list:
                        miss_files.append(cert)
                if len(miss_files) > 0:
                    print "Certificate files not exist while https enabled: %s" % str(miss_files)
